  input: '"TEXT","F3N","","On the original report there were five contributions reported
    and we didn''t have occupation and employer information for them.  We previously
    gave you copies of our best efforts information on these individuals.  We also
    did a second mailing to them requesting the information.  Three responded and
    their occupation and employer information is included with this amendment.  The
    other two did not respond to the second mailing.  After discussing this with Mr.
    Christopher A. Whyrick of your office we made attempts to call these individuals
